  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:03.623249\",\n\t\"name\": \"izembek-national-wildlife-refuge-annual-narrative-report-calendar-year-1985\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Izembek
  NWR, the Pavlof Unit of Alaska Peninsula NWR, and the Unimak and Amak Islands of
  Alaska Maritime NWR outlines Refuge accomplishments during the 1985 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, management planning, public participation, compliance with environmental
  and cultural resource mandates, and research and investigations. Refuge administration
  is outlined; information about personnel, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, grazing,
  fire management, and wilderness areas. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries resources,
  scientific collections, and marking and bird banding. The public uses of the Refuge
  described in this report include interpretive programs, hunting, fishing, trapping,
  wildlife observation, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, and major
  maintenance. Cooperative programs are provided at the end.\",\n\t\"license_title\":
